import React from 'react';
import styles from './AddFriendItem.module.css';
import RoundWrapper from '../util/RoundWrapper';
import DefaultUser from '../../assets/default-user.png';

export default function AddFriendItem() {
    return (
        <div>
            <RoundWrapper>
                <img src={DefaultUser} alt='user' diameter='50' />
            </RoundWrapper>
        </div>
    )
}
